def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.15:
            priorities[i] = 1 / (1 + np.exp(-20 * ratio))
        elif ratio >= 0.15 and ratio < 0.3:
            priorities[i] = 1 / (1 + np.exp(-18 * (ratio - 0.2))) + 0.2
        elif ratio >= 0.3 and ratio < 0.45:
            priorities[i] = 1 / (1 + np.exp(-16 * (ratio - 0.35))) - 0.1
        elif ratio >= 0.45 and ratio < 0.6:
            priorities[i] = 1 / (1 + np.exp(-14 * (ratio - 0.5))) + 0.15
        elif ratio >= 0.6 and ratio < 0.75:
            priorities[i] = 1 / (1 + np.exp(-12 * (ratio - 0.7))) - 0.05
        else:
            priorities[i] = 1 / (1 + np.exp(-10 * (ratio - 0.85))) + 0.1

        if i % 5 == 0:
            priorities[i] *= 1.2
        elif i % 5 == 1:
            priorities[i] *= 0.8
        elif i % 5 == 2:
            priorities[i] *= 1.1
        elif i % 5 == 3:
            priorities[i] *= 0.9
        else:
            priorities[i] *= 1.05

    return priorities
